import React from "react";
import { Text, Box, Container, Center } from "native-base";
import { Dimensions } from "react-native-web";

const { width, height } = Dimensions.get("window");

const App = () => {
  return (
    <Container>
      <Box
        w={width / 2}
        h={height / 2}
        position="fixed"
        top="50%"
        left="50%"
        borderWidth="1"
      >
        <Text>FA</Text>
      </Box>
    </Container>
  );
};

export default App;
